import React, { Component } from 'react';

class Projects extends Component {
  render() {
    return (
<div className="Projects">
My Project
<div class="row" style="padding: 6px 1px;font-size: 22px;">
							<div class="col-md-12" style="border-right: 1px solid gray;">
              <div class="card">
								<div>
												<h4 style="color:#707070;font-size:12px;padding-left: 10px;"><b>Contributor</b></h4>
												<hr style="margin: 1px 4px;background-color: #bdbdbd;height: 1px;">												
												<p>Architect & Engineer</p> 
											  </hr>
							</div>
              </div>
						</div>
</div>
</div>
    );
  }
}

export default Projects;
